import * as React from 'react';
import { useEffect } from 'react';
import { ExploreHeader } from '../layout/ExploreHeader';
import { PageTwo } from './PageTwo';
import { PageThree } from './PageThree';

const Page = ({ tag }) => {
  const page = {
    2: PageTwo,
    3: PageThree
  };

  const Components = page[tag];

  return (
    <>
      <header className='z-20 sticky bg-white top-0 '>
        <ExploreHeader white={true} placeholder='Try "Barcelona"' />
      </header>
      <Components />
    </>
  );
};

export default Page;
